const INITIAL_STATE = [];

export default function playlists(state = INITIAL_STATE, action) {
	switch (action.type) {
		case 'LIST_PLAYLISTS':
			return [...state, action.payload];
		case 'SEARCH_PLAYLISTS':
			console.log('reducers');
			console.log(...state);
			console.log(action.playlists);
			console.log([...state, action.playlists]);
			return [...state, action.payload];
		default:
			return state;
	}
}
